import Keycloak from 'keycloak-js';

const keycloak = new (Keycloak as new (config: any) => Keycloak)({
    url: 'http://localhost:8080',
    realm: 'project-manager',
    clientId: 'project-manager-frontend',
});

export default keycloak;
